import React, { useState } from "react";
import Autocomplete from "../PositionsComponents/Autocomplete";
import SearchResults from "./SearchResults";
import { get } from "../Helpers";

let stocks = new Map();
get(
  "https://finnhub.io/api/v1/stock/symbol?exchange=US&token=bpleiinrh5r8m26im1dg"
).then((res) => {
  for (let stock of res) {
    let symbol = stock["displaySymbol"];
    let firstChar = symbol[0];
    if (stocks.has(firstChar)) {
      stocks.get(firstChar).push(symbol);
    } else {
      stocks.set(firstChar, []);
    }
  }
});

export default function Companies(props) {
  const [symbol, setSymbol] = useState("");

  console.log(symbol);

  if (symbol) {
    return <SearchResults searchText={symbol}></SearchResults>;
  }

  return (
    <div
      style={{
        paddingTop: "40vh",
        paddingLeft: "23vw",
      }}
    >
      <Autocomplete setSymbol={setSymbol} search width={500}></Autocomplete>
    </div>
  );
}
